function SendPacket(packetIdx, data, length)
{
    var packet = [];

    packet[0] = 0x00;
    packet[1] = 0x56;
    packet[2] = 0x83;
    packet[3] = packetIdx;
    packet[4] = 0x00;
        
    var offset = 5;

    if (data.length !== length) {
        throw new Error("Data length is "+data.length+", but length is: "+length);
    }

    for (var iIdx = 0; iIdx <= length; iIdx++){    
        packet[iIdx+5] = data[iIdx];
    }
    
    device.write(packet, 65);    
}

function Apply()
{
    var packet = [];
    
    packet[0] = 0x00;
    packet[1] = 0x51;
    packet[2] = 0x28;
    packet[3] = 0x00;
    packet[4] = 0x00;
    packet[5] = 0xFF;
   
    device.write(packet, 65);
}

var iColor = 0;

export function Render()
{  
    iColor+=8;    
    if (iColor > 240) { iColor = 150; }

    
    
    var colors = new Array(560).fill(0);
    
    for (var iIdx = 0; iIdx < vKeymap.length; iIdx++) {
        var iKeyArrIdx = vKeymap[iIdx] * 3;
        var iKeyPosX = vLedPositions[iIdx][0];
        var iKeyPosY = vLedPositions[iIdx][1];
        var col = device.color(iKeyPosX, iKeyPosY);
        colors[iKeyArrIdx] = col[0];
        colors[iKeyArrIdx+1] = col[1];
        colors[iKeyArrIdx+2] = col[2];
    }


    var packet = [];
    packet[0] = 0x00;
    packet[1] = 0x56;
    packet[2] = 0x83;
    packet[3] = 0x00;
    packet[4] = 0x00;
    packet[5] = 0x01;
    packet[6] = 0x00;
    packet[7] = 0x00;
    packet[8] = 0x00;
    packet[9] = 0x80;
    packet[10] = 0x01;
    packet[11] = 0x00;
    packet[12] = 0xC1;
    packet[13] = 0x00;
    packet[14] = 0x00;
    packet[15] = 0x00;
    packet[16] = 0x00;
    packet[17] = 0xFF;
    packet[18] = 0xFF;
    packet[19] = 0xFF;
    packet[20] = 0xFF;
    packet[21] = 0x00;
    packet[22] = 0x00;
    packet[23] = 0x00;
    packet[24] = 0x00;
    packet[25] = 0x00;
    packet[26] = 0x00;
    packet[27] = 0x00;
    packet[28] = 0x00;
    packet[29] = 0x00;
    packet[30] = 0x00;
    var firstcol = colors.splice(0,13);
    var offset = 52;
    for(var iIdx = 0; iIdx < 14; iIdx++){
        packet[iIdx+offset] = firstcol[iIdx];
    }
    device.write(packet, 65);
  
    SendPacket(1, colors.splice(0, 60), 20 * 3);
    SendPacket(2, colors.splice(0, 60), 20 * 3);
    SendPacket(3, colors.splice(0, 60), 20 * 3);
    SendPacket(4, colors.splice(0, 60), 20 * 3);
    SendPacket(5, colors.splice(0, 60), 20 * 3);
    SendPacket(6, colors.splice(0, 60), 20 * 3);
    SendPacket(7, colors.splice(0, 60), 20 * 3);
    SendPacket(8, colors.splice(0, 60), 20 * 3);
    SendPacket(9, colors.splice(0, 60), 20 * 3);

    Apply();  
}


